import Layout from '../components/Layout.js';

const PostLink = (props) => (
  <li>
    <Link as={`/p/${props.id}`} href={`/post?title=${props.title}`}>
      <a>{props.title}</a>
    </Link>
  </li>
);

export default () => (
    <Layout>
        <div>
            <h1>INDEX.JS</h1>
        </div>
    </Layout>
);
